import React from "react";
import "./header.css"
import TypewriterComponent from "typewriter-effect";

const Header = () => (

    <header className="header">
        <h1>
            <TypewriterComponent
                options={{
                    autoStart: true,
                    loop: false,
                    delay: 50,
                    deleteSpeed: null, // Prevents deleting after typing
                    strings: ["RecipeFind"]
                }}
            />
        </h1>
    </header>

)

export default Header;
